    true,nt"url": null,nt"notes": "This dataset covers the geographic area
    within Wake County, North Carolina. The Wake Superior Court Judge Districts dataset
    shows the subdivisions of the North Carolina Superior Court's tenth district. This
    dataset includes polygons and labels representing each subdivision of the tenth
    district. The North Carolina Superior Court is divided into forty-six districts
    which are combined to form eight divisions. Wake County belongs to the third division
    and the tenth district. The tenth district is subdivided into smaller districts
    for electoral purposes.",nt"license_title": "Other License Specified",nt"extras":
